import './App.css';
import React from 'react';

class Professores extends React.Component
{
  constructor(props)
  {
    super(props);
    this.state = {
      professores: []
    };
    this.updateProfs();
  }
  updateProfs()
  {
    if (self.fetch)
    {
      fetch('http://docente.ifsc.edu.br/arliones.hoeller/test.json',
            {
              mode: 'no-cors',
              cache: 'no-cache',
              headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json'
              }
            })
      .then((response) =>
        {
          console.log(response);
          if (response.ok)
          {
            return response.json();
          }
          throw Error('Bad network response.');
        })
      .then((contents) =>
        {
          console.log(contents);
          console.log(this.state.professores);
          this.setState({professores: contents});
        })
      .catch((e) =>
        {
          console.log(e);
        });
    }
    else
    {
      console.log('No fetch.');
    }
  }
  render()
  {
    return (
      <div>
        <h1>Professores</h1>
        <ol>
          {this.state.professores.map((prof) => (
            <li key={prof.id}>{prof.name}</li>
          ))}
        </ol>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Professores/>
    </div>
  );
}

export default App;
